def sort_search(index, ranks, keyword):
	keyword = keyword.lower()
	if keyword not in index:
		return None
	url_list = index[keyword]["url"]
#	print url_list
	
	final_list = []
	
	for url in url_list:
		final_list.append([url, ranks[url] + index[keyword]["url"][url]["tscore"]])
#	print final_list
	
	from operator import itemgetter
	
	final_list.sort(key=itemgetter(1), reverse=True)
	return final_list
	
	
